  in permitting or siting decisions, but may be used as a reference source. This is
  public information and may be interpreted by organizations, agencies, units of government,
  or others based on needs; however, they are responsible for the appropriate application.
  Federal, State, or local regulatory bodies are not to reassign to the Natural Resources
  Conservation Service any authority for the decisions that they make. The Natural
  Resources Conservation Service will not perform any evaluations of these maps for
  purposes related solely to State or local regulatory programs.Photographic or digital
  enlargement of these maps to scales greater than those at which they were originally
  mapped can cause misinterpretation of the data. If enlarged, maps do not show the
  small areas of contrasting soils that could have been shown at a larger scale. The
  depicted soil boundaries, interpretations, and analysis derived from them do not
  eliminate the need for onsite sampling, testing, and detailed study of specific
  sites for intensive uses. Thus, these data and their interpretations are intended
  for planning purposes only. Digital data files are periodically updated. Files are
  dated, and users are responsible for obtaining the latest version of the data.\",
